import React from 'react';
import ReactDOM from 'react-dom';

// import App from './app';

import './index.css';

import * as serviceWorker from './serviceWorker';

function Clock(props) {
    return (
        <div>
            <p>title</p>
            <p>{props.date.toLocaleTimeString()}</p>
        </div>
    );
}

function tick() {
    ReactDOM.render(
        <Clock date={new Date()} />,
        document.getElementById('root')
    );
}

setInterval(tick, 1000)

